import Hero from './components/Hero';
import Nav from './components/nav';
import Container from './components/container';
import StockRoom from './components/StockRoom';
import TapNotes from './components/TapNotes';
import Structure from './components/Structure';
import Community from './components/Community';
import SwipeableViews from 'react-swipeable-views';
//import Scrolling from 'react-kinetic-scrolling';
//import  { Breakpoint, BreakpointProvider } from 'react-socks';

function HomePage() {
  return (
    <>
     <Nav/>
     <section className="bg-grey pt-10 pb-16 whitespace-pre-line">
           <Container> 
            <Hero/>
          </Container>
     </section> 

    <section>
     <Container>
      <TapNotes/>
     </Container>
    </section>

    <section className="bg-grey pt-16 pb-16">
     <Container>
      <Structure/>
     </Container>
    </section>

   <section className="pt-16 pb-16">
         <Container> 
          <StockRoom />
         </Container>
      </section>


    <section className="bg-grey pt-16 pb-16">
      <Container>
        <Community/>
      </Container>
    </section>

    </>
  )
}


export default HomePage
